import React from 'react';
import styled from 'styled-components';
import Paragraf from '../MainBlock/ParagrafMain';

import SubTitles from '../SubTitle';
import './Footer.css';


const Container = styled.div`
    width: 1040px;
    height: 240px;
    position: relative;
    top: 0px;
    margin: 0px auto;

`


const Box = styled.div`
 h3{
     text-transform: uppercase;
     width: 139px;
     font-size: 17px;
     margin: 10px;
     text-align: center;
     color: #8898AA;

 }
`

const Column = styled.div`
position:relative;
z-index: 1;
ul{
      list-style: none;
      text-align: center;
      margin: 10px;
      padding: 4px 0 12px;
      line-height: 22px;
      display: flex;
      flex-diraction: column;
      flex-wrap: wrap;
      max-height: 355px;

  }
  a{
    color: #8898AA;
     font-size: 15px;
     padding: 2px 10px;
  }

  li{
    padding: 4px 12px;


  }


`


class Footer extends React.Component {
  render(){
    return (
        <Container >
            <Box className="Grid">
            <Column>  
                <div className="Products"><SubTitles title="products"/></div>              
                <ul>

                    <li><a> Payments    </a> </li>
                    <li><a>  Billing     </a> </li>
                    <li><a>  Connect         </a> </li>
                    <li><a>  Payouts    </a> </li>
                    <li><a>  Atlas            </a> </li>
                    <li><a>  Radar  </a> </li>

                    <li><a>  Issuing    </a> </li>
                    <li><a>  Terminal     </a> </li>
                    <li><a>  Corporate Card         </a> </li>
                    <li><a>   Capital   </a> </li>
                </ul>
                <ul>
                    <li><a>   Platforms           </a> </li>


                    <li><a>  Marketplaces    </a> </li>
                    <li><a>  Pricing     </a> </li>
                    <li><a>  Global         </a> </li>
                    <li><a>  Guides         </a> </li>

                    </ul>
            </Column>

            <Column>  
                <div className="Developers"><SubTitles title="Developers"/></div>            
            <ul>

                <li><a>  Documentation   </a> </li>
                <li><a>  API reference    </a> </li>
                <li><a>  API status    </a> </li>
                <li><a>  Open source          </a> </li>

            </ul>
            </Column>

            <Column>  
                <div className="Company"><SubTitles title="Company"/></div>
            <ul>
                <li><a>  About    </a> </li>
                <li><a>  Enterprise     </a> </li>
                <li><a>  Customers         </a> </li>
                <li><a>  Partners    </a> </li>
                <li><a>  Jobs     </a> </li>
                <li><a>  Blog          </a> </li>
                <li><a>  Newsroom    </a> </li>
                <li><a>  Invoicing             </a> </li>
                <li><a>  Environment  </a> </li>
            </ul>
            </Column>

            <Column>  
                <div className="Resources"><SubTitles title="Resources"/></div>              
            <ul>
                <li><a>              Support    </a> </li>
                <li><a>   Contact     </a> </li>
                <li><a>  Privacy & terms         </a> </li>
                <li><a>   Sitemap   </a> </li>
            </ul>
            </Column>
            </Box>



        </Container>
    );
  }
}
export default Footer;
